  return (
    <Container>
      <div className="imgDiv">{/* <img src="../assets/background.jpg" alt="" /> */}</div>{" "}
      <div>
        <p className="nameHeader"> Jamila Israfilzadeh</p>
        <ul>
          <li>Phone:</li>
          {data.fullName}
          <li>Eamil:</li>
          {data.email}
          <li>Portfolio:</li>
          {data.portfolio}
          <li>LinkedIn:</li>
          {data.linkedin}
          <li>Date of birth:</li>
           
        </ul>
      </div>
    </Container>
  );
};

export default Contactinfos;

const Container = styled.div`
display: flex;
align-items: center;
